import { useEffect, useState } from "react";
import { Link } from "react-router-dom";

function Plastic() {
    const [product, setproduct] = useState([]);

    useEffect(() => {
        let apiUrl = 'http://localhost:4000/plastic'
        fetch(apiUrl, { method: "GET" })
            .then(response => response.json())
            .then(data => setproduct(data))
            .catch(err => console.error("Error fetching data: ", err));
    }, []);


    const formatePro = product.map(item => {
        return (
            <div className="col-3 p-2 me-4">
            <div className="card" style={{ width: '18rem' }}>
                <div className="divimage">
                <img src={item.img} class="card-img-top mainimage" alt="..." />
                </div>
                <div className="card-body">
                    {/* <h2>
                        {item.id}
                    </h2> */}
                    <h5 className="card-title">{item.name}</h5>
                    <p className="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
                    <Link to={'/ReadMore'} class="btn btn-primary" >Read More...</Link>
                </div>
            </div>
            </div>

        )
    })


    return (
        <>
            <div className="container">
                <div className="row">
                {formatePro}
                    
                    
                    </div>
                   
                </div>

        </>
    );
}

export default Plastic;
